import React, { Component } from "react";

class SearchBox extends Component {
  constructor() {
    super();
  }

  render() {
    const lupa = <img src='../images/lupa.png' alt='lupa'/>

    return (
      <>
        <form action="">
          <div>
            <input
              type="search"
              name="search"
              placeholder="Buscar produtos, marcas e muito mais... "
            />

            {lupa}
          </div>
        </form>
      </>
    );
  }
}

export default SearchBox;
